import 'bootstrap/dist/css/bootstrap.min.css';
import { useNavigate } from "react-router-dom";

export default function GridItem({ produto }) { // Recebe um array de produtos
    const navigate = useNavigate();

    const movimentar = (id) => {
        navigate(`/MovimentarProduto/${id}`);
    };

    return (
        <ul className="list-group">
            <li className="list-group-item d-flex justify-content-between align-items-center bg-light">
                <div className="font-weight-bold">Código EAN</div>
                <div className="font-weight-bold">Produto</div>
                <div className="font-weight-bold">Preço</div>
                <div className="font-weight-bold">Categoria</div>
                <div className="font-weight-bold">Quantidade</div>
                <div>Ações</div>
            </li>

        </ul>
    );
}
